/* STATEFUL PARENT COMPONENT */
const MainList = ({ classes, students }) => {
  classes = Array.isArray(classes) ? classes : [];
  students = Array.isArray(students) ? students : [];
  return (
    <div>
      <hr />
      This is the main list stateless child component.
      <div>
        <p> Classes: </p>
        {/* Check that the class object exists */}
        {classes.length > 0 && (
          <ul>
            {/* Using getter for class Object to display name */}
            {classes.map((c) => (
              <li key={c.id}>
                {" "}
                {c.id} | {c.get("Name")}{" "}
              </li>
            ))}
          </ul>
        )}
      </div>{" "}
      <div>
        <p> Students: </p>
        {/* Check that the student object exists */}
        {students.length > 0 && (
          <ul>
            {/* Using getter for student Object to display name */}
            {students.map((student) => (
              <li key={student.id}>
                {" "}
                {student.id} | {student.get("firstName")}{" "}
              </li>
            ))}
          </ul>
        )}
      </div>{" "}
    </div>
  );
};

export default MainList;
